v0=t.createElement("br")
v1=T.a(" Abstract: The design of a software architecture is not purely a technical issue. It also involves numerous social, human and organizational aspects that can influence the success of an architecture and thus an entire project considerably. Therefore, the focus is on the people involved, mainly, the software architect. ")
v2=t.createElement("br")
v3=t.createElement("br")
v4=T.a(" The software architect is an experienced member in the development team responsible to make design choices, validate them, capture them in various related artifacts, and communicate those decisions to interested stakeholders. The software engineering community has started to study more the role of software architects and their responsibilities. However, studies involving software architects working in different companies, and domains, with different cultures and experiences are welcome, since we do not have a sufficient understanding of what novice and experienced software architects do when they design, evaluate, and document a software architecture. ")
v5=t.createElement("br")
v6=t.createElement("br")
v7=T.a(" In this talk, we present the results of semi-structured interviews with 28 software architects from five different countries working on a wide range of application domains. Our goal was to understand the perceptions from software architects on whiteboard architecture meetings and to understand the transition from architectural sketches to code. Based on the results, we provide a set of recommendations for researchers and practitioners. ")
