al7=T.a("A Sess\xe3o de Ferramentas \xe9 um evento integrante do X Congresso Brasileiro de Software: Teoria e Pr\xe1tica (CBSoft 2019), que agrega quatro tradicionais e bem estabelecidos simp\xf3sios:")
al8=t.createElement("br")
al9=t.createElement("br")
am0=T.a(" [SBES 2019] XXXIII Simp\xf3sio Brasileiro de Engenharia de Software")
am1=t.createElement("br")
am2=T.a(" [SBLP 2019] XXIII Simp\xf3sio Brasileiro de Linguagens de Programa\xe7\xe3o")
am3=t.createElement("br")
am4=T.a(" [SBCARS 2019] XIII Simp\xf3sio Brasileiro de Componentes, Arquiteturas e Reutiliza\xe7\xe3o de Software")
am5=t.createElement("br")
am6=T.a(" [SAST 2019] IV Simp\xf3sio Brasileiro de Teste de Software Sistem\xe1tico e Automatizado")
am7=t.createElement("br")
am8=t.createElement("br")
am9=T.a(" A Sess\xe3o de Ferramentas foi promovida tradicionalmente ao longo de v\xe1rios anos como um dos eventos integrantes do SBES e do SBCARS. A partir do CBSoft 2010, houve pela primeira vez uma \xfanica Sess\xe3o de Ferramentas, agregando contribui\xe7\xf5es de pesquisadores e profissionais de todas comunidades vinculadas ao CBSoft. ")
an0=t.createElement("br")
an1=t.createElement("br")
an2=T.a(" O objetivo da Sess\xe3o de Ferramentas \xe9 proporcionar um f\xf3rum para apresenta\xe7\xe3o e demonstra\xe7\xe3o de solu\xe7\xf5es automatizadas que apoiam o processo de desenvolvimento e gerenciamento de software em suas mais diversas necessidades e manifesta\xe7\xf5es. O p\xfablico-alvo inclui membros da comunidade acad\xeamica e da ind\xfastria. Os acad\xeamicos podem apresentar os resultados de seus projetos de pesquisa aplicados nas seguintes \xe1reas: Engenharia de Software; Linguagens de Programa\xe7\xe3o; Componentes, Arquiteturas e Reutiliza\xe7\xe3o de Software; e Teste de Software. Profissionais da ind\xfastria s\xe3o tamb\xe9m bem vindos para apresentar ferramentas comerciais ou de uso interno que tragam ganhos significativos de produtividade e/ou qualidade para atividades do processos de desenvolvimento de software.")
an3=t.createElement("br")
an4=t.createElement("br")
an5=T.a(" Os autores de trabalho da Sess\xe3o de Ferramentas ter\xe3o a oportunidade de apresentar e divulgar suas ferramentas para os participantes do SBES, SBLP, SBCARS, SAST, e dos diversos workshops integrantes do CBSoft (e.g., VEM). A Sess\xe3o de Ferramentas consiste em uma exposi\xe7\xe3o te\xf3rica e uma pr\xe1tica da ferramenta.")
an6=t.createElement("br")
an7=t.createElement("br")
an8=t.createElement("hr")
an9=t.createElement("h2")
T.d(an9,"T\xf3picos De Interesse")
ao0=T.a("Os autores est\xe3o convidados a submeter trabalhos descrevendo solu\xe7\xf5es automatizadas para os mais diversos aspectos e necessidades relacionados com os temas discutidos nos 4 simp\xf3sios do CBSoft 2019: SBES, SBLP, SBCARS e SAST.")
ao1=t.createElement("br")
ao2=t.createElement("br")
ao3=T.a(" Uma lista n\xe3o-exaustiva de t\xf3picos de interesse da Sess\xe3o de Ferramentas inclui (em ordem alfab\xe9tica):")
ao4=t.createElement("br")
ao5=t.createElement("br")
ao6=T.a(" - Ambientes de suporte e compiladores de Linguagens de Programa\xe7\xe3o")
ao7=t.createElement("br")
ao8=T.a(" - Arquiteturas de Software")
ao9=t.createElement("br")
ap0=T.a(" - Desenvolvimento de software orientado a objetos e a aspectos")
ap1=t.createElement("br")
ap2=T.a(" - Desenvolvimento Dirigido por Modelos")
ap3=t.createElement("br")
ap4=T.a(" - Desenvolvimento Distribu\xeddo de Software")
ap5=t.createElement("br")
ap6=T.a(" - Engenharia de Linhas de Produto de Software")
ap7=t.createElement("br")
ap8=T.a(" - Engenharia de Requisitos")
ap9=t.createElement("br")
aq0=T.a(" - Engenharia de Software Experimental")
aq1=t.createElement("br")
aq2=T.a(" - Ger\xeancia de Configura\xe7\xe3o")
aq3=t.createElement("br")
aq4=T.a(" - Manuten\xe7\xe3o, Reengenharia e Refatora\xe7\xe3o de Software")
aq5=t.createElement("br")
aq6=T.a(" - M\xe9tricas e Medi\xe7\xf5es em Engenharia de Software")
aq7=t.createElement("br")
aq8=T.a(" - Processos de Software")
aq9=t.createElement("br")
ar0=T.a(" - Reutiliza\xe7\xe3o de Software")
ar1=t.createElement("br")
ar2=T.a(" - Verifica\xe7\xe3o, Valida\xe7\xe3o e Testes de Software")
ar3=t.createElement("br")
ar4=t.createElement("br")
ar5=t.createElement("hr")
ar6=t.createElement("h2")
T.d(ar6,"Instru\xe7\xf5es Para A Submiss\xe3o")
ar7=T.a("A submiss\xe3o envolve um *artigo e um v\xeddeo curtos* sobre a ferramenta, de acordo com as diretrizes a seguir:")
ar8=t.createElement("br")
ar9=t.createElement("br")
as0=T.a(" 1) O artigo deve ser original, n\xe3o podendo ter sido submetido simultaneamente a outros eventos cient\xedficos ou peri\xf3dicos, nem publicado em outro ve\xedculo. O conte\xfado do artigo dever\xe1 abordar, pelo menos, e de forma clara, os seguintes pontos:")
as1=t.createElement("br")
as2=t.createElement("br")
as3=T.a(" a) Descri\xe7\xe3o e motiva\xe7\xe3o do problema abordado pela ferramenta.")
as4=t.createElement("br")
as5=t.createElement("br")
as6=T.a(" b) Descri\xe7\xe3o das principais funcionalidades e dos potenciais usu\xe1rios da ferramenta.")
as7=t.createElement("br")
as8=t.createElement("br")
as9=T.a(" c) Exemplo de uso, possivelmente com um estudo de caso e telas que ilustram a interface da ferramenta (quando aplic\xe1vel).")
at0=t.createElement("br")
at1=t.createElement("br")
at2=T.a(" d) Arquitetura da ferramenta com enfoque em seus principais componentes de software e nas interfaces entre eles.")
at3=t.createElement("br")
at4=t.createElement("br")
at5=T.a(" e) Breve compara\xe7\xe3o com outras ferramentas relacionadas existentes.")
at6=t.createElement("br")
at7=t.createElement("br")
at8=T.a(" f) O tipo de licen\xe7a.")
at9=t.createElement("br")
au0=t.createElement("br")
au1=T.a(" 2) Os artigos poder\xe3o ser escritos em portugu\xeas ou ingl\xeas. Artigos redigidos em portugu\xeas devem tamb\xe9m incluir o resumo em ingl\xeas, de acordo com o template informado a seguir. N\xe3o devem exceder ***6 (seis) p\xe1ginas***, incluindo todas as figuras, refer\xeancias e ap\xeandices, e devem ser submetidos em arquivo do tipo PDF. Solicitamos aos autores que as figuras sejam geradas com boa qualidade. O formato da SBC para publica\xe7\xe3o de artigos deve ser seguido: ")
au2=t.createElement("a")
T.b(au2,bm5,bm9)
T.d(au2,bm9)
au3=T.a(". IMPORTANTE: artigos que n\xe3o seguirem as instru\xe7\xf5es aqui apresentadas ser\xe3o rejeitados sem passarem pelo processo de avalia\xe7\xe3o. 3) Os v\xeddeos possuem o objetivo de demonstrar o uso da ferramenta, chamando a aten\xe7\xe3o dos avaliadores para as principais contribui\xe7\xf5es que ela oferece. Sugere-se que os v\xeddeos sigam as seguintes diretrizes:")
au4=t.createElement("br")
au5=t.createElement("br")
au6=T.a(" a) O v\xeddeo deve ser disponibilizado no youtube.com e deve ter ***dura\xe7\xe3o entre 3 e 5 minutos***.")
au7=t.createElement("br")
au8=t.createElement("br")
au9=T.a(" b) O link para o v\xeddeo da ferramenta deve ser colocado logo abaixo do abstract do artigo.")
av0=t.createElement("br")
av1=t.createElement("br")
av2=T.a(" c) Deve haver um locutor apresentando a ferramenta. A fala pode ser em portugu\xeas ou ingl\xeas. ")
av3=t.createElement("br")
av4=t.createElement("br")
av5=T.a(" d) Deve haver uma breve introdu\xe7\xe3o, dando uma vis\xe3o geral da ferramenta e de seus objetivos.")
av6=t.createElement("br")
av7=t.createElement("br")
av8=T.a(" e) Devem ser apresentadas, se aplic\xe1vel, todas as funcionalidades da ferramenta.")
av9=t.createElement("br")
aw0=t.createElement("br")
aw1=T.a(" f) Devem ser mostradas as sa\xeddas que a ferramenta produz, com enfoque na qualidade dos resultados.")
aw2=t.createElement("br")
aw3=t.createElement("br")
aw4=T.a(" g) Dependendo da ferramenta, pode ser interessante usar um exemplo ou estudo de caso de aplica\xe7\xe3o da mesma.")
aw5=t.createElement("br")
aw6=t.createElement("br")
aw7=t.createElement("hr")
aw8=t.createElement("h2")
T.d(aw8,"Informa\xe7\xf5es Gerais")
aw9=T.a("- A aceita\xe7\xe3o de um artigo implica que pelo menos um autor se inscrever\xe1 no CBSoft para apresent\xe1-lo.")
ax0=t.createElement("br")
ax1=t.createElement("br")
ax2=T.a(" - As submiss\xf5es devem ser feitas pelo site: ")
