ay1=T.a("A Sess\xe3o de Ferramentas \xe9 tradicionalmente realizada em dois dias:")
ay2=t.createElement("br")
ay3=t.createElement("br")
ay4=T.a(" 1o dia: os autores far\xe3o apresenta\xe7\xf5es orais das ferramentas (apresenta\xe7\xe3o te\xf3rica). ")
ay5=t.createElement("br")
ay6=t.createElement("br")
ay7=T.a(" 2o dia: os autores ter\xe3o um espa\xe7o para realizar a demonstra\xe7\xe3o das ferramentas aos interessados (demonstra\xe7\xe3o pr\xe1tica). Note-se que a demonstra\xe7\xe3o pr\xe1tica consiste em realmente exibir a ferramenta funcionando. O v\xeddeo elaborado para a submiss\xe3o n\xe3o deve ser usado nessa demonstra\xe7\xe3o. Tanto a apresenta\xe7\xe3o te\xf3rica quanto a pr\xe1tica s\xe3o obrigat\xf3rias para todas as ferramentas aceitas. O formato e o tempo de cada apresenta\xe7\xe3o ser\xe3o divulgados posteriormente.")
