T.d(e4,": Agile software development (ASD) has been increasingly adopted in industry. However, recent empirical works have shown that requirements approaches for ASD still neglect non-functional requirements (NFRs). From the analysis of recent works, it was noticed that although several studies were concerned with privacy requirements, none of them proposes a requirements specification approach to be used in the context of ASD. Considering this, the tutorial has the purpose of presenting the overall state of privacy in Requirements Engineering (RE) and presenting Privacy Criteria Method (PCM) to deal with privacy issues in the context of agile RE.")
