T.d(e4,": Carla Silva is a professor at the CIn-UFPE, since 2011. She has a Ph.D. in Computer Science from UFPE (2007). Her research interests are RE, Model Driven Engineering (MDE), Software Product Lines (SPL) and Adaptive Systems.")
