T.d(e4,"Software engineering involves the consideration of both human and technical factors, and although its origins come from the sub-disciplines of computer science and engineering, the importance of the social and human aspects of software development are widely accepted by current practitioners and researchers alike. Researchers have at their disposal many research methods they can choose from, but which methods are best suited to capturing the social and human aspects of thesocio-technical endeavour that is software development? In this hands-on and interactive tutorial, we will use a research strategy framework to distinguish the different strengths and weaknesses of how various research methods can capture the human aspects of software engineering research. We will use a design science lens to understand the different types of research contributions we may encounter in our software engineering research projects, and which methods may be best suited to those anticipated contribution types (such as descriptive and explanatory theories, or technical solutions). ")
