T.d(e4," Artificial intelligence has the potential to facilitate collaboration and coordination in software development organizations by facilitating access to knowledge, optimizing workflows, and coordinating interdependent work. But in order to have a positive impact, it is essential that intelligent systems are designed to work harmoniously with the naturally-occurring human processes that make groups of people collectively intelligent. This lecture will survey several of the most important of these human processes, including social networks, transactive memory, and sense-making in transparent environments. It will explain how each mechanism works, how it facilitates organizational performance, and how it could potentially be enhanced with smart technologies.")
T.c(s,a2,d6)
