T.d(a4," James Herbsleb is a Professor in the Institute for Software Research in the School of Computer Science at Carnegie Mellon University. His research interests lie primarily in the intersection of software engineering, computer-supported cooperative work, and socio-technical systems, focusing on such areas as geographically distributed development teams and large-scale open source development. He holds a PhD in psychology, and an MS in computer science. His research has won several awards, including the ACM Outstanding Research Award (2016), Alan Newell Award for Research Excellence (2014), Most Influential Paper award (ICSE 2010), and distinguished or best paper awards at ICSE, Academy of Management, ESEM, and CSCW. For about two decades, he has worked with many extraordinary colleagues to try to understand the complex and dynamic relationship between human collaboration and the software that the humans are designing and using.")
