T.d(e4," Interactive Theorem Provers (ITPs) like Coq and Lean are now sophisticated tools allowing the proof of highly challenging theorems in a wide range of domains, with highlights such as the proof of the Four-color Theorem and the certification of a cryptographic algorithm currently shipped within the Chrome browser. Their use is well-established in certain areas of academia, and is slowly gaining terrain in the construction of critical software in the industry.")
T.c(s,e4,d6)
T.d(e4,' In a nutshell, an ITP comprises of a language in which to write theorems and proofs, surrounded with an ecosystem of tools to help in the process of proof writing. Each step in a proof, which can be executed line by line to obtain immediate feedback, can vary from very simple statements, such as "this follows from an assumption", to using sophisticated proof search techniques to construct proofs that would otherwise take several lines.')
T.c(s,e4,d6)
T.d(e4," However, despite their maturity, they still present several challenges that remain to be solved. To put it succinctly, we do not yet know how to effectively construct proofs, at least not for the wide domains in which ITPs are being used. In this tutorial I will provide an introduction to the area in general and Coq in particular. and present some of the recent advances aiming at improving ITPs.")
