T.d(e4,": Beta Ziliani is a researcher and lecturer in the group LIIS at FAMAF, Universidad Nacional de C\xf3rdoba (UNC), and CONICET. He did a PhD with honors at the MPI-SWS under the supervision of Dr. Derek Dreyer, a and a MSc (licenciatura) at FCEyN, Universidad de Buenos Aires (UBA), under the supervision of Alejandro R\xedos. Beta's research primarily focuses on building tools to improve the experience of constructing mathematical proofs in a computer. He is the creator of Mtac, a plugin for building well-typed proof-automation procedures in the Coq theorem prover.")
