T.d(p,"Context And Objective")
o=T.a("The IX Workshop on Theses and Dissertations of CBSoft (WTDSoft 2019) is a permanent event associated with the Brazilian Congress on Software: Theory and Practice (CBSoft), dedicated to the presentation and discussion of master's and doctoral works in progress in the areas of Software Engineering and Programming Languages. The CBSoft 2019 will be held in Salvador-BA, September 23-27, 2019.")
n=t.createElement("hr")
m=t.createElement("h2")
T.d(m,"The Workshop")
l=T.a("CBSoft was created in 2010 to integrate important Brazilian scientific events, such as: Brazilian Symposium on Software Engineering (SBES), Brazilian Symposium on Programming Languages \u200b\u200b(SBLP), Brazilian Symposium on Software Components, Architectures, and Reuse (SBCARS), and Brazilian Symposium on Systematic and Automated Software Testing (SAST). WTDSoft has its roots in the Workshop on Theses and Dissertations in Software Engineering (WTES), an event co-located with SBES from 1996 to 2010. WTDSoft currently seeks to integrate the SBES, SBLP, SBCARS and SAST communities, in order to provide a constructive environment for discussions between students with work in progress and researchers in the areas of Software Engineering and Programming Languages.")
k=t.createElement("hr")
j=t.createElement("h2")
T.d(j,"Eligibility And Evaluation")
i=T.a("Masters or doctoral works are eligible for submission, preferably:")
h=t.createElement("br")
g=T.a(" - Doctoral work with a defined proposal (not necessarily approved)")
f=t.createElement("br")
e=T.a(" - Masters work with an approved proposal (desirable, but not mandatory) and expected deadline after December 2019")
d=t.createElement("br")
c=T.a(" - Works that have not been accepted or presented in other workshops on theses and dissertations.")
b=t.createElement("br")
a=T.a(ba6)
a0=t.createElement("br")
a1=T.a(" The works will be evaluated and selected by the program committee. Each paper will receive a feedback from the committee with questions and suggestions about its content. These comments should be used by the author in the preparation of the paper\u2019s final version. Selected papers will be presented and discussed during WTDSoft, with program committee members and invited researchers. Acceptance of the work implies the author's registration in WTDSoft (and also in CBSoft) and his/her presence for the presentation of the work. The presentation may be in Portuguese or English. We assume that the author is the graduate student responsible for the development of the thesis or dissertation.")
a2=t.createElement("hr")
a3=t.createElement("h2")
T.d(a3,"Submission")
a4=T.a("The submission should follow the Brazilian Computer Society (SBC) template, A4 size, containing a cover page and up to 06 pages for master's and 08 pages for doctoral work (07 and 09 pages, respectively). Word and Latex templates can be obtained from the SBC portal (https://tinyurl.com/h24v37f). ")
a5=t.createElement("br")
a6=T.a(" All papers must be written in Portuguese or English and submitted in JEMS.")
a7=t.createElement("br")
a8=T.a(ba6)
a9=t.createElement("br")
b0=T.a(" The final version of the accepted papers should contain an informal letter or message from the advisor acknowledging the submission. The number of pages reported in JEMS refers to content pages, not including the cover page or letter of agreement.")
b1=t.createElement("br")
b2=T.a(ba6)
b3=t.createElement("br")
b4=T.a(" The works must contain a cover page containing:")
