c1=t.createElement("br")
c2=T.a(" - Level (master's or PhD)")
c3=t.createElement("br")
c4=T.a(" - Graduate program")
c5=t.createElement("br")
c6=T.a(" - Student's email")
c7=t.createElement("br")
c8=T.a(" - Email of the advisor(s)")
c9=t.createElement("br")
d0=T.a(" - Entry year in the program")
d1=t.createElement("br")
d2=T.a(" - Expected date for final presentation")
d3=t.createElement("br")
d4=T.a(" - Date of approval of the thesis / dissertation proposal (qualification)")
d5=t.createElement("br")
d6=T.a(" - Abstract in Portuguese or in English")
d7=t.createElement("br")
d8=T.a(" - Keywords")
d9=t.createElement("br")
e0=T.a(" - Acronym(s) of the related CBSoft event(s) (SBES, SBCARS, SBLP, SAST).")
e1=t.createElement("br")
e2=T.a(ba6)
e3=t.createElement("br")
e4=T.a(" The content of the work should start on the second page, describing clearly and objectively:")
