aa0=t.createElement("br")
aa1=t.createElement("p")
T.d(aa1,"IX Workshop de Teses e Disserta\xe7\xf5es do CBSoft (WTDSoft 2019)")
T.c(t,aa1,"br")
T.d(aa1," 23 a 27 de Setembro de 2019, Salvador, BA, Brasil")
aa2=t.createElement("br")
aa3=t.createElement("hr")
aa4=t.createElement("h2")
T.d(aa4,"Contexto E Objetivo")
aa5=t.createElement("p")
T.d(aa5,"O IX Workshop de Teses e Disserta\xe7\xf5es do CBSoft (WTDSoft 2019) \xe9 um evento permanente associado ao Congresso Brasileiro de Software: Teoria e Pr\xe1tica (CBSoft), dedicado \xe0 apresenta\xe7\xe3o e \xe0 discuss\xe3o de trabalhos de mestrado e doutorado em andamento nas \xe1reas de Engenharia de Software, Linguagens de Programa\xe7\xe3o e Teste de Software. O CBSoft 2019 ser\xe1 realizado em Salvador \u2013 BA (hor\xe1rio de Bras\xedlia), de 23 a 27 de Setembro de 2019.")
aa6=t.createElement("br")
aa7=t.createElement("hr")
aa8=t.createElement("h2")
T.d(aa8,"Hist\xf3rico")
aa9=t.createElement("p")
T.d(aa9,"O CBSoft foi criado em 2010, com o objetivo de integrar importantes eventos cient\xedficos brasileiros, a saber: Simp\xf3sio Brasileiro de Engenharia de Software (SBES), Simp\xf3sio Brasileiro de Linguagens de Programa\xe7\xe3o (SBLP), Simp\xf3sio Brasileiro de Componentes, Arquiteturas e Reutiliza\xe7\xe3o de Software (SBCARS) e Simp\xf3sio Brasileiro de Teste de Software Sistem\xe1tico e Automatizado (SAST).")
ab0=t.createElement("p")
T.d(ab0,"O WTDSoft tem sua origem no Workshop de Teses e Disserta\xe7\xf5es em Engenharia de Software (WTES), evento integrante do SBES de 1996 a 2010. O WTDSoft busca promover a integra\xe7\xe3o das comunidades do SBES, SBLP, SBCARS e SAST, de modo a propiciar um ambiente construtivo para discuss\xf5es entre estudantes com trabalhos em andamento e pesquisadores nas \xe1reas de Engenharia de Software e Linguagens de Programa\xe7\xe3o.")
ab1=t.createElement("br")
ab2=t.createElement("hr")
ab3=t.createElement("h2")
T.d(ab3,"Elegibilidade E Avalia\xe7\xe3o")
ab4=t.createElement("p")
T.d(ab4,"S\xe3o eleg\xedveis para submiss\xe3o trabalhos de mestrado ou doutorado, preferencialmente:")
ab5=T.a("- Trabalhos de doutorado com proposta definida (n\xe3o necessariamente aprovada)")
ab6=t.createElement("br")
ab7=T.a(" - Trabalhos de mestrado com proposta aprovada (desej\xe1vel, mas n\xe3o obrigat\xf3rio) e prazo previsto de conclus\xe3o posterior a dezembro de 2019")
ab8=t.createElement("br")
ab9=T.a(" - Trabalhos que n\xe3o tenham sido aceitos ou apresentados em outros workshops de teses e disserta\xe7\xf5es.")
ac0=t.createElement("br")
ac1=t.createElement("p")
T.d(ac1,"Os trabalhos ser\xe3o avaliados e selecionados pelo comit\xea de programa do evento. Cada trabalho receber\xe1 um parecer do comit\xea com questionamentos e sugest\xf5es sobre o seu conte\xfado. Esses coment\xe1rios dever\xe3o ser utilizados pelo autor na prepara\xe7\xe3o da vers\xe3o final do artigo. Os trabalhos selecionados ser\xe3o apresentados e discutidos durante o WTDSoft, com membros do comit\xea de programa e pesquisadores convidados. A aceita\xe7\xe3o do trabalho implica a inscri\xe7\xe3o do autor no WTDSoft (para se inscrever no WTDSoft, \xe9 necess\xe1ria e suficiente inscri\xe7\xe3o no CBSoft) e a sua presen\xe7a para a apresenta\xe7\xe3o do trabalho. A apresenta\xe7\xe3o poder\xe1 ser feita em portugu\xeas ou em ingl\xeas. Entende-se que o autor \xe9 o aluno de p\xf3s-gradua\xe7\xe3o respons\xe1vel pelo desenvolvimento da tese ou disserta\xe7\xe3o de mestrado.")
ac2=t.createElement("br")
ac3=t.createElement("hr")
ac4=t.createElement("h2")
T.d(ac4,"Instru\xe7\xf5es Para Submiss\xe3o")
ac5=t.createElement("p")
T.d(ac5,"O formato do artigo dever\xe1 seguir o modelo da Sociedade Brasileira de Computa\xe7\xe3o (SBC), em tamanho A4, contendo folha de rosto e at\xe9 06 p\xe1ginas de conte\xfado para trabalhos de mestrado e 08 p\xe1ginas de conte\xfado para trabalhos de doutorado (totalizando, respectivamente, 07 e 09 p\xe1ginas). Descri\xe7\xf5es Word e Latex deste modelo podem ser obtidas no portal da SBC, seguindo a refer\xeancia para Eventos e Modelo para publica\xe7\xe3o de artigos (https://tinyurl.com/h24v37f).")
ac6=t.createElement("p")
T.d(ac6,"Todos os artigos devem ser escritos em portugu\xeas ou ingl\xeas e submetidos pelo JEMS. A vers\xe3o final dos artigos aceitos dever\xe1 conter uma carta ou mensagem informal do orientador dando ci\xeancia e concord\xe2ncia com a submiss\xe3o. O n\xfamero p\xe1ginas informado no JEMS refere-se somente a p\xe1ginas de conte\xfado, sem contar folha de rosto ou carta de concord\xe2ncia.")
ac7=t.createElement("p")
T.d(ac7,"Os trabalhos devem conter uma folha de rosto em que constam exclusivamente:")
ac8=T.a("- T\xedtulo do trabalho")
ac9=t.createElement("br")
ad0=T.a(" - Nome do aluno")
ad1=t.createElement("br")
ad2=T.a(" - Nome do(s) orientador(es)")
ad3=t.createElement("br")
ad4=T.a(" - N\xedvel (mestrado ou doutorado)")
ad5=t.createElement("br")
ad6=T.a(" - Programa de p\xf3s-gradua\xe7\xe3o")
ad7=t.createElement("br")
ad8=T.a(" - Email de contato do aluno")
ad9=t.createElement("br")
ae0=T.a(" - Email de contato do(s) orientador(es)")
ae1=t.createElement("br")
