ae3=t.createElement("br")
ae4=T.a(" - \xc9poca prevista de conclus\xe3o")
ae5=t.createElement("br")
ae6=T.a(" - Data da aprova\xe7\xe3o da proposta de tese/disserta\xe7\xe3o (qualifica\xe7\xe3o)")
ae7=t.createElement("br")
ae8=T.a(" - Resumo em portugu\xeas ou em ingl\xeas")
ae9=t.createElement("br")
af0=T.a(" - Palavras-chave")
af1=t.createElement("br")
af2=T.a(" - Sigla(s) do(s) evento(s) do CBSoft relacionado(s)(SBES, SBCARS, SBLP, SAST).")
af3=t.createElement("br")
af4=t.createElement("p")
T.d(af4,"O conte\xfado do trabalho deve iniciar na segunda p\xe1gina e deve ser descrito de forma clara e objetiva, incluindo os seguintes conte\xfados:")
af5=T.a("- Caracteriza\xe7\xe3o do Problema.")
