T.d(T.c(t,p,"p"),"Gordon Fraser is a Full Professor in Computer Science at the University of Passau. He received his Ph.D. from Graz University of Technology, Austria, in 2007, then worked as a post-doc researcher at Saarland University, Germany, and as a (Senior) Lecturer at the University of Sheffield until 2017. He has published on improving software quality and programmer productivity at all major software engineering venues (e.g., TSE, TOSEM, ICSE, ISSTA, FSE, ASE, ICST) and has received six ACM SIGSOFT Distinguished Paper Awards (FSE'14, ISSTA'14, ASE'14, ASE'15, ESEC/FSE'15, ICSE'17), as well as best paper awards at SSBSE and GECCO. He has been programme chair of software engineering conferences (ASE, ICST, TAP, TAIC PART, SSBSE) and workshops, is a regular member of many programme and organising committees in the field (e.g., ICSE, FSE, ASE, ISSTA), is associate editor of the IEEE Transactions on Software Engineering (TSE) and Software Testing, Verification, and Reliability (STVR) journals.")
o=T.c(t,p,"p")
T.d(T.c(t,o,"b"),"Talk:Gamifying Software Testing")
T.c(t,o,h)
T.d(o," Writing good software tests is difficult and not every developer\u2019s favourite occupation. If an activity is so difficult, boring, or otherwise unattractive that people do not want to engage with it, then gamification offers a solution: By turning the activity into a fun and competitive task, participants engage, compete, and excel. In this talk, I will explore how this idea can be applied to software testing. Our ongoing work with the Code Defenders game demonstrates that players engage with testing, and perceive it as a fun activity. At the same time, by participating in the game, players produce test suites that are far superior to anything automated testing tools generate. This illustrates the potential of using gamification to address some of the many problems that we are facing today in software testing. There are, however, many challenges ahead, and I will outline some of the challenges and research opportunities related to gamifying software testing.")
