T.d(T.c(t,l,"p"),"Alan Gularte is a Senior Software Engineering at Dell. Since 2013 he is supporting global performance testing and quality engineering programs, leading distributed teams in Brazil and India. He joined Dell after 6 years working as a web and mobile developer. He has Specialization in Big Data & Data Science and is always involved with innovation initiatives involving automation to merge Quality Engineering with Artificial Intelligence. Alan is passionate about technology and people management, because he believes both areas need to walk together. He loves traveling (especially to Italy and India) and meeting people from different cultures.")
k=T.c(t,l,"p")
T.d(T.c(t,k,"b"),"Talk: Software Testing in a Digital transformation Journey")
T.c(t,k,h)
T.d(k," In this new area of digital transformations, testers are seeing a sea of changes on how they traditionally tests software in terms of skills, process and tools. Machine Learning/AI, devops, agile and continuous testing are disrupting the testing community, and forcing them to find ways to test faster and with excellence. In this lecture, Alan Gularte will share how to overcome the main challenges in automation and performance testing in this context, making the best use of technology such as bots and test tools.")
