T.d(T.c(t,o,"b"),"Title: Lessons and Insights from Tech Transfers at Microsoft")
T.c(t,o,f)
T.d(o,' As a basic industrial research lab, Microsoft Research expects its members to both publish basic research and put it into practice. Unfortunately, moving from a validated technique or model in a published paper to a state where that same technique is being used by and providing value to software development projects on a regular basis in a consistent and timely fashion is a time consuming, fraught, and difficult task. We have attempted to make this transition, which we call "Tech Transfer", many times in the empirical software engineering group (ESE) at Microsoft Research. Much like research in general, there have been both triumphs and setbacks, but each experience has provided valuable insight and informed our next effort. This talk shares our experiences from successes and failures and provides lessons and guidance that can be used by others trying to transfer their research into practice in both industrial and academic contexts.')
T.d(T.c(t,p,"p"),"Christian Bird is a principal researcher in the Empirical Software Engineering group at Microsoft Research. He is primarily interested in the relationship between software design, social dynamics, and processes in large development projects and in developing tools and techniques to help software teams. He has studied software development both quantitatively and qualitatively at Microsoft, IBM, and in the Open Source realm. Most recently his work has focused on code review, use of branching in source code repositories, and release engineering. He has published in the top Software Engineering venues and his research has been highlighted in the Communications of the ACM. Christian received B.S. from Brigham Young University and his Ph.D. from the University of California, Davis.")
