T.c(t,j,f)
T.d(j," Abstract: The design of a software architecture is not purely a technical issue. It also involves numerous social, human and organizational aspects that can influence the success of an architecture and thus an entire project considerably. Therefore, the focus is on the people involved, mainly, the software architect. ")
T.c(t,j,f)
T.c(t,j,f)
T.d(j," The software architect is an experienced member in the development team responsible to make design choices, validate them, capture them in various related artifacts, and communicate those decisions to interested stakeholders. The software engineering community has started to study more the role of software architects and their responsibilities. However, studies involving software architects working in different companies, and domains, with different cultures and experiences are welcome, since we do not have a sufficient understanding of what novice and experienced software architects do when they design, evaluate, and document a software architecture. ")
T.c(t,j,f)
T.c(t,j,f)
T.d(j," In this talk, we present the results of semi-structured interviews with 28 software architects from five different countries working on a wide range of application domains. Our goal was to understand the perceptions from software architects on whiteboard architecture meetings and to understand the transition from architectural sketches to code. Based on the results, we provide a set of recommendations for researchers and practitioners. ")
T.c(t,j,f)
T.c(t,j,f)
T.d(T.c(t,j,"p"),"Eduardo Santana de Almeida is an associate professor in the Department of Computer Science at the Federal University of Bahia, where he leads the RiSE (Reuse in Software Engineering) Labs. His research interests include software reuse, software product lines, software architecture, and empirical software engineering. Almeida received a Ph.D. in computer science from the Federal University of Pernambuco. He\u2019s a senior member of ACM and IEEE, and an affiliate member of Brazilian Academy of Sciences (ABC). Contact him at esa@dcc.ufba.br .")
