w8=t.createElement("p")
T.d(w8,"O SBES est\xe1 fazendo parcerias com revistas internacionais para incorporar os artigos submetidos como Journal First na trilha de pesquisa do SBES 2019.")
w9=t.createElement("p")
T.d(w9,"A IEEE Software e o Journal de Pesquisa e Desenvolvimento de Engenharia de Software (JSERD), agora como peri\xf3dico mantido pela SBC, confirmaram sua parceria com o SBES 2019. Os autores dos artigos journal-first aceitos nesses peri\xf3dicos poder\xe3o apresentar seu trabalho de pesquisa no SBES. Isso oferece uma oportunidade para os autores discutirem seu trabalho com a comunidade, bem como enriquece o programa t\xe9cnico do SBES.")
x0=t.createElement("br")
x1=T.a("\nOs seguintes crit\xe9rios de avalia\xe7\xe3o ser\xe3o usados \u200b\u200bpara selecionar os artigos journal-first no SBES 2019:")
x2=t.createElement("br")
x3=T.a(" - O artigo descreve resultados originais que n\xe3o s\xe3o extens\xf5es de documentos anteriores publicados em confer\xeancias.")
x4=t.createElement("br")
x5=T.a("\n- O artigo foi aceito para publica\xe7\xe3o no peri\xf3dico at\xe9 1\xba de janeiro de 2017.")
x6=t.createElement("br")
x7=T.a("\n- O artigo n\xe3o foi apresentado em nenhuma outra confer\xeancia como journal-first.")
x8=t.createElement("br")
x9=T.a("\n- Os trabalhos selecionados ser\xe3o apresentados no programa t\xe9cnico da trilha de pesquisa do SBES. Pelo menos um autor por journal-first selecionado precisar\xe1 se registrar e participar do simp\xf3sio para apresent\xe1-lo.")
