T.d(s,"- This track focuses on new and inspiring ideas with promising future results, as well as on research work in progress with preliminary and interesting results. The track welcomes innovative new software engineering approaches - methods, techniques, tools - in early stages of research. Papers on this track are reviewed based on its novelty, relevance, technical soundness, and clarity of presentation. The track has been organized since SBES 2015 and the previous proceedings are available at the IEEE (2015) and ACM (2016, 2017, and 2018) digital libraries.")
