f3=T.a("Papers can be written in Portuguese or English. Submission in English is strongly encouraged since the symposium proceedings will be indexed by the ACM Digital Library. Submitted papers must not have been simultaneously submitted to any other forum (conference or journal), nor should they have already been published elsewhere. At least one author of each accepted paper must register for the conference and present the paper in person during the event or the paper will not be included in the proceedings. All submissions must be in Adobe Portable Document Format (PDF) and must comply with the ACM 2-column conference (ACM_SigConf) format available at http://www.acm.org/publications/proceedings-template. ")
f4=t.createElement("br")
f5=T.a(" They must be no longer than 6 pages, including all figures and references. Papers should be submitted electronically through JEMS system (http://submissoes.sbc.org.br). All submitted papers should inform after the abstract the language in which they are written. Submissions that are not in compliance with the required submission format or that are out of the scope of the symposium will be rejected without reviewing. ")
