T.d(g1,"DOUBLE-BLIND SUBMISSION")
g2=T.a("SBES 2019 Insightful Ideas and Emerging Results track will follow a double-blind review process. All submitted papers should conceal the identity of the authors. Both author names and affiliations must be omitted. In addition, the following rules should be addressed:")
g3=t.createElement("br")
g4=t.createElement("br")
g5=T.a(' - You should ensure that citations to your own related work are written in the third person. For example, you must write \u201cthe previous work of Silva et al.\u201d as opposed to \u201cour previous work.\u201d As a heuristic, look for occurrences of "we", "our", "ours", "github", "funding", etc., in your paper and remove them prior to submitting.')
g6=t.createElement("br")
g7=t.createElement("br")
g8=T.a(" - In the submitted paper, you should not mention any artifact in a repository or website that allows identifying the authorship. If you need to make available any artifact, please anonymize it in the repository/website.")
g9=t.createElement("br")
