h1=T.a(' - If the submitted paper is a direct follow up of your previous work, e.g., an expanded version of a previously-published short paper, you may anonymize the reference in the submitted paper. For example, \u201cthe previous work of Silva et al.\u201d can be adapted to "based on previous work [X]", and the reference at the end of the paper can be presented as "[X] Anonymous authors. Not presented due to double blind review."')
