au9.y=new V.D()
w9=T.a("Esta trilha foca em ideias novas e inspiradoras com resultados promissores para o futuro, assim como em trabalhos de pesquisa em andamento com resultados preliminares e interessantes. A trilha acolhe novas abordagens inovadoras de engenharia de software - m\xe9todos, t\xe9cnicas, ferramentas - em est\xe1gios iniciais de pesquisa. Os artigos nesta trilha s\xe3o revisados \u200b\u200bcom base em sua novidade, relev\xe2ncia, solidez t\xe9cnica e clareza de apresenta\xe7\xe3o. A trilha \xe9 organizada desde o SBES 2015 e os anais dos anos anteriores est\xe3o dispon\xedveis nas bibliotecas digitais do IEEE (2015) e da ACM (2016, 2017 e 2018). ")
