ad9=T.a("Os trabalhos podem ser escritos em Portugu\xeas ou Ingl\xeas. A submiss\xe3o em ingl\xeas \xe9 fortemente encorajada, uma vez que os anais do simp\xf3sio ser\xe3o indexados pela Biblioteca Digital da ACM. Os artigos submetidos n\xe3o devem ter sido submetidos simultaneamente a nenhum outro f\xf3rum (confer\xeancia ou revista), nem devem ter sido publicados em outro lugar. Pelo menos um autor de cada trabalho aceito deve se inscrever para a confer\xeancia e apresentar o trabalho pessoalmente durante o evento ou o trabalho n\xe3o ser\xe1 inclu\xeddo nos anais. Todas as submiss\xf5es devem estar no formato Adobe Portable Document Format (PDF) e devem estar de acordo com o modelo ACM de 2 colunas (ACM_SigConf) dispon\xedvel em http://www.acm.org/publications/proceedings-template. Eles devem ter no m\xe1ximo 6 p\xe1ginas, incluindo todas as figuras e refer\xeancias. Os trabalhos devem ser submetidos eletronicamente atrav\xe9s do sistema JEMS (http://submissoes.sbc.org.br). ")
ae0=t.createElement("br")
ae1=T.a("\nTodos os trabalhos submetidos devem informar ap\xf3s o resumo a l\xedngua em que est\xe3o escritos. As inscri\xe7\xf5es que n\xe3o estiverem em conformidade com o formato de envio exigido ou que estiverem fora do escopo do simp\xf3sio ser\xe3o rejeitadas sem revis\xe3o. Todos os outros trabalhos ser\xe3o revisados \u200b\u200bpor pelo menos tr\xeas membros do Comit\xea do Programa. ")
ae2=t.createElement("br")
ae3=t.createElement("hr")
ae4=t.createElement("br")
ae5=t.createElement("h2")
T.d(ae5,"SUBMISS\xc3O DUPLO-CEGO")
ae6=T.a("A trilha de Ideias Inovadoras e Resultados Emergentes do SBES 2019 seguir\xe1 um processo de revis\xe3o duplo-cego. Todos os trabalhos submetidos devem ocultar a identidade dos autores. Tanto nomes de autores quanto afilia\xe7\xf5es devem ser omitidos. Al\xe9m disso, as seguintes regras devem ser abordadas:")
ae7=t.createElement("br")
ae8=T.a(' - Voc\xea deve garantir que as cita\xe7\xf5es a seu trabalho relacionado sejam escritas na terceira pessoa. Por exemplo, voc\xea deve escrever "o trabalho anterior de Silva et al.", ao inv\xe9s de "nosso trabalho anterior". Como heur\xedstica, procure por ocorr\xeancias de "n\xf3s", "nosso", "nossa", "github", " financiamento ", etc., em seu documento e remova-as antes de submeter o trabalho.')
ae9=t.createElement("br")
af0=t.createElement("br")
af1=T.a(" - No artigo submetido, voc\xea n\xe3o deve mencionar nenhum artefato em um reposit\xf3rio ou site que permita identificar a autoria. Se voc\xea precisar disponibilizar qualquer artefato, por favor anonimize-o no site/reposit\xf3rio.")
af2=t.createElement("br")
af3=t.createElement("br")
af4=T.a(' - Se o trabalho submetido \xe9 uma continua\xe7\xe3o do seu trabalho anterior, por exemplo, uma vers\xe3o estendida de um artigo curto publicado previamente, voc\xea pode anonimizar a refer\xeancia no artigo submetido. Por exemplo, \u201co trabalho anterior de Silva et al.\u201d Pode ser adaptado para \u201cbaseado no trabalho anterior [X]\u201d, e a refer\xeancia no final do artigo pode ser apresentada como \u201c[X] autores an\xf4nimos. para revis\xe3o duplo-cego".')
af5=t.createElement("br")
af6=t.createElement("br")
af7=T.a(" - Ap\xf3s a aceita\xe7\xe3o do artigo, voc\xea pode incluir todas as informa\xe7\xf5es (sem anonimiza\xe7\xe3o) na vers\xe3o final.")
af8=t.createElement("br")
af9=t.createElement("br")
ag0=T.a(' - Caso voc\xea tenha alguma d\xfavida sobre a prepara\xe7\xe3o do seu trabalho seguindo as regras de dupla oculta\xe7\xe3o, envie um e-mail para os coordenadores da trilha com o assunto "SBES: pergunta sobre as regras de duplo-cego".')
