j=t.createElement("br")
i=T.a(" The Brazilian Symposium on Software Engineering (SBES), annually promoted by the Brazilian Computer Society (SBC), is the premier Software Engineering event in Latin America. SBES is held in conjunction with CBSoft - Brazilian Conference on Software: Theory and Practice. The CBSoft program includes technical research sessions, insightful ideas sessions, industry sessions, invited talks, courses, tutorials, panels, demonstration of software tools, Ph.D. and M.Sc. theses workshop, and several other satellite events. It traditionally gathers nearly 600 people, including academics, practitioners, and students.")
h=t.createElement("br")
g=T.a(be1)
f=t.createElement("br")
e=T.a(" In 2019, SBES will include three tracks. The Research Track publishes solid results with a strong contribution to the Software Engineering community. The Insightful Ideas and Emerging Results Track provides opportunity for researchers and practitioners to submit and present innovative and promising ideas and results in early stages of research. The Education Track (former FEES - Forum of Education in Software Engineering) publishes papers that address challenges, innovations, and best practices in Software Engineering education. For details of the Research Track, and Insightful Ideas and Emerging Results Track, please refer to the specific calls for papers or access the conference website.")
