a2=t.createElement("br")
a3=T.a(" SBES Education Track welcomes quality submissions covering curriculum development, empirical studies, best practices, personal or institutional experiences, and conceptual or theoretical work are particularly invited. Papers on this track are reviewed based on their originality, relevance, technical soundness, and clarity of presentation.")
