h2=t.createElement("br")
h3=T.a(" Papers must be written in Portuguese or English. Submissions in English are strongly encouraged since the symposium proceedings are indexed in the ACM Digital Library. All papers title and abstract must be written in English. The acceptance of a paper implies that at least one of its authors will register for the symposium to present it. ")
h4=t.createElement("br")
