ab8=t.createElement("br")
ab9=T.a(" O Simp\xf3sio Brasileiro de Engenharia de Software (SBES), promovido anualmente pela Sociedade Brasileira de Computa\xe7\xe3o (SBC), \xe9 o principal evento de Engenharia de Software da Am\xe9rica Latina. O SBES \xe9 realizado em conjunto com a CBSoft - Confer\xeancia Brasileira de Software: Teoria e Pr\xe1tica, que tradicionalmente re\xfane aproximadamente 600 pessoas, incluindo acad\xeamicos, profissionais e estudantes. O SBES inclui tr\xeas trilhas: Pesquisa, Ideias Inovadoras e Resultados Emergentes, e Educa\xe7\xe3o. Para obter detalhes sobre as trilhas de Pesquisa e Ideias Inovadoras e Resultados Emergentes, consulte as chamadas espec\xedficas para artigos ou acesse o site da confer\xeancia.")
ac0=t.createElement("br")
