ac4=t.createElement("br")
ac5=t.createElement("h3")
T.d(ac5,"A TRILHA DE EDUCA\xc7\xc3O")
ac6=t.createElement("br")
ac7=T.a(" A trilha de Educa\xe7\xe3o do SBES, antigo FEES - F\xf3rum de Educa\xe7\xe3o em Engenharia de Software, foca na discuss\xe3o de desafios, boas pr\xe1ticas e inova\xe7\xf5es no ensino de Engenharia de Software. Os anais das edi\xe7\xf5es anteriores de 2017 e 2018 podem ser encontrados na Biblioteca Digital da ACM. ")
ac8=t.createElement("br")
ac9=t.createElement("br")
ad0=T.a(" Busca-se submiss\xf5es de qualidade que tratem de assuntos relacionados ao desenvolvimento de curr\xedculo, estudos emp\xedricos, melhores pr\xe1ticas, experi\xeancias institucionais ou pessoais, e trabalhos te\xf3ricos ou conceituais. Os artigos nesta trilha s\xe3o revisados com base em sua originalidade, relev\xe2ncia, solidez t\xe9cnica e clareza na apresenta\xe7\xe3o. ")
