af9=t.createElement("br")
ag0=T.a(" Convidamos submisso\u0303es sobre o ensino da engenharia de software em diversos cen\xe1rios (por exemplo, sala de aula, curso de capacita\xe7\xe3o complementar, ensino universit\xe1rio, ensino t\xe9cnico), incluindo, mas na\u0303o se limitando, aos to\u0301picos listados a seguir:")
ag1=t.createElement("br")
ag2=T.a(be1)
ag3=t.createElement("br")
ag4=T.a(" - Boas pr\xe1ticas e pr\xe1ticas inovadoras para o ensino de Engenharia de Software;")
ag5=t.createElement("br")
ag6=T.a(" - Curr\xedculo ou projetos de curso inovadores;")
ag7=t.createElement("br")
ag8=T.a(" - Ensino de Engenharia de Software em cursos de Ci\xeancia da Computa\xe7\xe3o, Sistemas de Informa\xe7\xe3o, Tecnologia da Informa\xe7\xe3o e outros;")
ag9=t.createElement("br")
ah0=T.a(" - Ensino de m\xe9todos, t\xe9cnicas e ferramentas para o desenvolvimento de software;")
ah1=t.createElement("br")
ah2=T.a(" - Ensino de Engenharia de Software em ambientes n\xe3o tradicionais, tais como hackathons;")
ah3=t.createElement("br")
ah4=T.a(" - Ambientes educacionais emergentes para engenharia de software, tais como aprendizado online;")
ah5=t.createElement("br")
ah6=T.a(" - Experi\xeancias de ensino/aprendizado utilizando abordagens em novos cen\xe1rios pr\xe1ticos da Engenharia de Software, tais como: m\xe9todos \xe1geis, c\xf3digo aberto, desenvolvimento de software distribu\xeddo, computa\xe7\xe3o em nuvem, big data, dispositivos m\xf3veis, sistemas embarcados, rob\xf3tica e outros;")
ah7=t.createElement("br")
ah8=T.a(" - Ferramentas e m\xe9todos para avalia\xe7\xe3o do aprendizado de Engenharia de Software;")
ah9=t.createElement("br")
ai0=T.a(" - Estrat\xe9gias de ensino/aprendizado que considerem o conhecimento de quest\xf5es humanas, pol\xedticas, \xe9ticas, legais, profissionais e sociais na Engenharia de Software;")
ai1=t.createElement("br")
ai2=T.a(" - Integra\xe7\xe3o de experi\xeancias pr\xe1ticas no ensino da Engenharia de Software;")
ai3=t.createElement("br")
ai4=T.a(" - Integra\xe7\xe3o entre pesquisa e ensino de Engenharia de Software;")
ai5=t.createElement("br")
ai6=T.a(" - Uso de novas tecnologias no ensino de Engenharia de Software;")
ai7=t.createElement("br")
ai8=T.a(" - Interdisciplinaridade em Engenharia de Software: relacionamento com outras disciplinas e cursos, tais como artes, m\xfasica, administra\xe7\xe3o, economia e psicologia;")
ai9=t.createElement("br")
aj0=T.a(" - M\xe9todos inovadores que promovem o estudo e estimulam o aprendizado de professores, mantendo-os atualizados para o ensino de Engenharia de Software;")
aj1=t.createElement("br")
aj2=T.a(" - Ensino em Engenharia de Software que estimula o empreendedorismo, especialmente a cria\xe7\xe3o de startups; e")
aj3=t.createElement("br")
aj4=T.a(" - C\xf3digo aberto no ensino de Engenharia de Software.")
