ak2=t.createElement("h3")
T.d(ak2,"PREPARA\xc7\xc3O E SUBMISS\xc3O DO MANUSCRITO")
ak3=t.createElement("br")
ak4=T.a(" Os trabalhos podem ser escritos em Portugue\u0302s ou Ingle\u0302s. A submissa\u0303o em ingle\u0302s e\u0301 fortemente encorajada, uma vez que os anais do simpo\u0301sio sera\u0303o indexados pela Biblioteca Digital da ACM. T\xedtulo e resumo de todos os artigos devem estar em ingl\xeas, mesmo se escritos em portugu\xeas. Os artigos submetidos na\u0303o devem ter sido submetidos simultaneamente a nenhum outro fo\u0301rum (confere\u0302ncia ou revista), nem devem ter sido publicados em outro lugar. Pelo menos um autor de cada trabalho aceito deve se inscrever para a confere\u0302ncia e apresentar o trabalho pessoalmente durante o evento ou o trabalho na\u0303o sera\u0301 inclui\u0301do nos anais. ")
ak5=t.createElement("br")
ak6=T.a(be1)
ak7=t.createElement("br")
ak8=T.a(" Os artigos devem ter no ma\u0301ximo 10 pa\u0301ginas, incluindo todas as figuras e refere\u0302ncias. Todas as submisso\u0303es devem estar no formato Adobe Portable Document Format (PDF) e devem estar de acordo com o modelo ACM de 2 colunas (ACM_SigConf) disponi\u0301vel em ")
ak9=t.createElement("a")
T.b(ak9,bg0,bl6)
T.d(ak9,bl6)
al0=T.a(". Os trabalhos devem ser submetidos eletronicamente atrave\u0301s do sistema JEMS (")
al1=t.createElement("a")
T.b(al1,bg0,bl7)
T.d(al1,bl7)
al2=T.a("). Todos os trabalhos submetidos devem informar apo\u0301s o resumo a li\u0301ngua em que esta\u0303o escritos. As inscric\u0327o\u0303es que na\u0303o estiverem em conformidade com o formato de envio exigido ou que estejam fora do escopo da Trilha de Educa\xe7\xe3o ser\xe3o rejeitadas sem revis\xe3o. Todos os outros artigos ser\xe3o revisados por pelo menos tr\xeas membros do Comit\xea do Programa. ")
al3=t.createElement("br")
al4=T.a(" O processo de revis\xe3o inclui um per\xedodo de rebuttal em que os autores ter\xe3o acesso aos coment\xe1rios dos revisores e poder\xe3o argumentar e responder a perguntas dos revisores antes da decis\xe3o final de aceita\xe7\xe3o / rejei\xe7\xe3o. O rebuttal \xe9 limitado a um texto simples de at\xe9 4.000 caracteres (incluindo espa\xe7os).")
al5=t.createElement("br")
al6=T.a(be1)
al7=t.createElement("br")
al8=t.createElement("hr")
al9=t.createElement("br")
am0=t.createElement("h3")
T.d(am0,"SUBMISSA\u0303O DUPLO-CEGO")
am1=t.createElement("br")
am2=T.a(" A Trilha de Educa\xe7\xe3o do SBES 2019 seguira\u0301 um processo de revisa\u0303o duplo-cego. Todos os trabalhos submetidos devem ocultar a identidade dos autores. Tanto nomes de autores quanto afiliac\u0327o\u0303es devem ser omitidos. ")
am3=t.createElement("br")
am4=T.a(" Ale\u0301m disso, as seguintes regras devem ser abordadas:")
am5=t.createElement("br")
am6=T.a(' - Voce\u0302 deve garantir que as citac\u0327o\u0303es a seu trabalho relacionado sejam escritas na terceira pessoa. Por exemplo, voce\u0302 deve escrever "o trabalho anterior de Silva et al.", ao inve\u0301s de "nosso trabalho anterior". Como heuri\u0301stica, procure por ocorre\u0302ncias de "no\u0301s", "nosso", "nossa", "github", " financiamento" etc., em seu documento e remova-as antes de submeter o trabalho.')
am7=t.createElement("br")
am8=T.a(be1)
am9=t.createElement("br")
an0=T.a(" - No artigo submetido, voce\u0302 na\u0303o deve mencionar nenhum artefato em um reposito\u0301rio ou site que permita identificar a autoria. Se voce\u0302 precisar disponibilizar qualquer artefato, por favor anonimize-o no site/reposito\u0301rio.")
an1=t.createElement("br")
an2=T.a(be1)
an3=t.createElement("br")
an4=T.a(' - Se o trabalho submetido e\u0301 uma continuac\u0327a\u0303o do seu trabalho anterior, por exemplo, uma versa\u0303o estendida de um artigo curto publicado previamente, voce\u0302 pode anonimizar a refere\u0302ncia no artigo submetido. Por exemplo, \u201co trabalho anterior de Silva et al.\u201d Pode ser adaptado para \u201cbaseado no trabalho anterior [X]\u201d, e a refere\u0302ncia no final do artigo pode ser apresentada como \u201c[X] autores ano\u0302nimos. para revisa\u0303o duplo-cego".')
an5=t.createElement("br")
an6=T.a(be1)
an7=t.createElement("br")
an8=T.a(" - Apo\u0301s a aceitac\u0327a\u0303o do artigo, voce\u0302 poder\xe1 incluir todas as informac\u0327o\u0303es (sem anonimizac\u0327a\u0303o) na versa\u0303o final.")
an9=t.createElement("br")
ao0=T.a(be1)
ao1=t.createElement("br")
ao2=T.a(' - Caso voce\u0302 tenha alguma du\u0301vida sobre a preparac\u0327a\u0303o do seu trabalho seguindo as regras de dupla ocultac\u0327a\u0303o, envie um e-mail para os coordenadores da trilha com o assunto "SBES Trilha de Educa\xe7\xe3o: Pergunta sobre as regras de duplo-cego".')
