e2=t.createElement("p")
T.d(e2,"Design degradation implies on a systematic deterioration of various attributes of software quality, such as comprehensibility, maintainability and others. Many symptoms in a software, such smells, are used as a (limited) partial sign of design degradation. Many techniques for combating such degradation symptoms, such as refactoring, have been employed by developers in practice. However, design degradation in a software project is often a very long, slow, and complex process; the same holds for the process of combating such design degradation. Both processes cannot be truly understood if they are studied in terms of isolated events. For example, focusing on the observation of each smell or each single refactoring that was introduced in a commit does not offer enough context to truly understand how the design as a whole is either degrading or recovering from it. Moreover, activities that contribute to both processes are often: (i) intertwined with other daily activities in software development, such as adding or enhancing features or even fixing bugs, and (ii) intertwined among themselves \u2013 e.g., a developer can refactor the code in a commit, but this change may end up inducing new smells (or even bugs) along the next commits. However, most of the existing research in this field tends to study these processes in terms of \u201cisolated events\u201d in an oversimplified manner. This talk intends to pinpoint what is missing or even misleading while we focus on understanding design degradation and its recovery in this manner. This discussion will be supported by examples taken from recent or ongoing research. We will also discuss some ideas for future research in the field.")
e3=t.createElement("p")
T.d(e3,"Alessandro Garcia is an Associate Professor at the Informatics Department of the Pontifical Catholic University of Rio de Janeiro (PUC-RIO). Alessandro holds a PhD in Informatics from PUC-RIO (2004). He served as an Assistant Professor at the University of Lancaster (England) from February 2005 to January 2009. He served as a member of the Editorial Board of two leading international journals in his field: IEEE Transactions on Software Engineering and Journal of Systems and Software. He has been frequently invited to the Program Committees and / or Organization Committees of the major international conferences of Software Engineering and related areas such as ICSE, FSE, ICSME, MODELS, ICPC, ESEM, and several others. He has received several awards, distinctions and acknowledgments, such as Best Masters Dissertation of 2000 (Brazilian Society of Computing), Best Researcher of the Year (Lancaster University, 2006), Rio's Young Scientist (FAPERJ, 2009 and 2013, 2016) and Affiliated Member of the Brazilian Academy of Sciences (ABC, 2009 to 2014). Several of his articles have received distinctions at major international conferences in his area, such as the ACM Distinguished Paper Award of ICSE 2014. He has several partnerships with other international research groups in the USA, England, Germany and Argentina. Its research projects are funded by development agencies - CNPq, CAPES, FAPERJ and Newton Fund - and by partners in the software industry.")
