T.d(d1,"Journal First Submissions")
d2=T.a("SBES is partnering with international journals to incorporate Journal First papers into the SBES 2019 Research track.")
d3=t.createElement("br")
d4=t.createElement("br")
d5=T.a(" The IEEE Software and SBC Journal of Software Engineering Research and Development (JSERD) have confirmed their partnership with SBES 2019. Authors of journal-first papers accepted in those journals will be invited to present their research work at SBES. This offers an opportunity for authors to discuss their work with the community as well as enrich the technical program of SBES.")
d6=t.createElement("br")
d7=T.a(bq3)
d8=t.createElement("br")
d9=T.a(" The following evaluation criteria will be used to select journal first papers to SBES 2019:")
e0=t.createElement("br")
e1=T.a(bq3)
e2=t.createElement("br")
e3=T.a(" - The paper describes original results that are not extensions of previous conference papers.")
e4=t.createElement("br")
e5=T.a(" - The paper was accepted for publication in the journal no earlier than January 1st, 2017.")
e6=t.createElement("br")
e7=T.a(" - The paper has not been presented at any other conference as journal first.")
e8=t.createElement("br")
e9=T.a(" - The selected papers will be presented in the technical program of the SBES Research Track. At least one author per selected journal first paper will need to register and attend the symposium to present it.")
f0=t.createElement("br")
f1=T.a(bq3)
f2=t.createElement("br")
f3=T.a(" - Regarding journal first papers published in JSERD, we accept submissions of papers from the following categories: Research Articles, Case Studies, and Review. ")
f4=t.createElement("br")
f5=t.createElement("br")
f6=T.a(" - Regarding journal-first papers published in IEEE Software, we accept peer-reviewed research papers (not editorially-reviewed or invited papers). ")
f7=t.createElement("br")
f8=t.createElement("br")
f9=T.a(" Authors interested in presenting journal first papers at SBES 2019 should send an email to (")
g0=t.createElement("a")
T.b(g0,br9,"mailto:rafaelp@pucrs.br")
T.d(g0,"rafaelp@pucrs.br")
g1=T.a(') with the subject "Journal First - SBES 2019" by May 31st, 2019. The following information must be provided: (i) paper title; (ii) list of authors; (iii) web link to the paper; and (iv) a short statement on how the work satisfies the criteria above.')
g2=t.createElement("br")
