T.d(h0,"Outstanding Reviewer Award")
h1=t.createElement("p")
T.d(h1,"SBES 2019 acknowledges the generosity of the reviewers who give their time and best effort to referee submitted papers. The progress of scientific growth depends on dedicated colleagues, who aim to further the development of technology by offering their attention and passion when reviewing the papers. A certificate of Outstanding Reviewer will be awarded to reviewer/s who submitted outstanding quality reviews to SBES. The evaluation will be based on two criteria: quality; and usefulness of reviews, as evaluated by the paper authors and PC Chairs.")
