i1=t.createElement("p")
T.d(i1,"Authors of the Research Track papers, 'after the abstract' in the submission form, should indicate which one of the following categories their paper most closely adheres to. This intends to establish a consistent set of expectations in the review process.")
i2=t.createElement("p")
T.d(T.c(t,i2,bt6),"Analytical")
T.d(i2,": A paper in which the main contribution relies on new algorithms or mathematical theory. Examples include new bug prediction techniques, model transformations, algorithms for dynamic and static analysis, and reliability analysis. Such a contribution must be evaluated with a convincing analysis of the algorithmic details, whether through a proof, complexity analysis, or runtime analysis, among others and depending on the objectives.")
i3=t.createElement("p")
T.d(T.c(t,i3,bt6),"Experimental (primary study)")
T.d(i3,": A paper in which the main contribution is the experimental study of a software engineering technology or phenomenon. This includes controlled experiments, quasi experiments, case studies, and surveys of professionals reporting qualitative or quantitative data and analysis results. Such a contribution will be judged on its study design, appropriateness and correctness of its analysis, and threats to validity. Replications are welcome.")
i4=t.createElement("p")
T.d(T.c(t,i4,bt6),"Literature review (secondary study)")
T.d(i4,": A paper in which the main contribution is the synthesis of primary studies. Examples include systematic reviews and systematic mappings. Such a contribution should follow a sound methodology and provide a comprehensive coverage of the relevant literature. Moreover, it should answer relevant research questions with a deep synthesis of the results. Contributions that only provide metadata analysis (e.g., relevant authors, publications density by year, most influential papers, etc.) are discouraged.")
i5=t.createElement("p")
T.d(T.c(t,i5,bt6),"Technological")
T.d(i5,": A paper in which the main contribution is of a technical nature. This includes novel tools, modeling languages, infrastructures, and other technologies. Such a contribution does not necessarily need to be evaluated with humans. However, clear arguments, backed up by evidence as appropriate, must show how and why the technology is beneficial, whether it is in automating or supporting some user task, refining our modeling capabilities, improving some key system property, etc.")
i6=t.createElement("p")
T.d(T.c(t,i6,bt6),"Methodological")
T.d(i6,": A paper in which the main contribution is a coherent system of broad principles and practices to interpret or solve a problem. This includes novel requirements elicitation methods, process models, design methods, development approaches, programming paradigms, and other methodologies. The authors should provide convincing arguments with commensurate experiences, as well as explain why a new method is needed and what the benefits of the proposed method are.")
