T.d(ai0,"SUBMISS\xd5ES PARA JOURNAL-FIRST")
ai1=T.a("O SBES est\xe1 fazendo parcerias com revistas internacionais para incorporar os artigos submetidos como Journal First na trilha de pesquisa do SBES 2019.")
ai2=t.createElement("br")
ai3=T.a(bq3)
ai4=t.createElement("br")
ai5=T.a(" A IEEE Software e o Journal de Pesquisa e Desenvolvimento de Engenharia de Software (JSERD), agora como peri\xf3dico mantido pela SBC, confirmaram sua parceria com o SBES 2019. Os autores dos artigos journal-first aceitos nesses peri\xf3dicos poder\xe3o apresentar seu trabalho de pesquisa no SBES. Isso oferece uma oportunidade para os autores discutirem seu trabalho com a comunidade, bem como enriquece o programa t\xe9cnico do SBES.")
ai6=t.createElement("br")
ai7=T.a(bq3)
ai8=t.createElement("br")
ai9=T.a(" Os seguintes crit\xe9rios de avalia\xe7\xe3o ser\xe3o usados \u200b\u200bpara selecionar os artigos journal-first no SBES 2019:")
aj0=t.createElement("br")
aj1=T.a(bq3)
aj2=t.createElement("br")
aj3=T.a(" - O artigo descreve resultados originais que n\xe3o s\xe3o extens\xf5es de documentos anteriores publicados em confer\xeancias.")
aj4=t.createElement("br")
aj5=T.a(" - O artigo foi aceito para publica\xe7\xe3o no peri\xf3dico at\xe9 1\xba de janeiro de 2017.")
aj6=t.createElement("br")
aj7=T.a(" - O artigo n\xe3o foi apresentado em nenhuma outra confer\xeancia como journal-first.")
aj8=t.createElement("br")
aj9=T.a(" - Os trabalhos selecionados ser\xe3o apresentados no programa t\xe9cnico da trilha de pesquisa do SBES. Pelo menos um autor por journal-first selecionado precisar\xe1 se registrar e participar do simp\xf3sio para apresent\xe1-lo.")
ak0=t.createElement("br")
ak1=T.a(bq3)
ak2=t.createElement("br")
ak3=T.a(" - Em rela\xe7\xe3o aos artigos publicados no JSERD, aceitamos submiss\xf5es de trabalhos das seguintes categorias: artigos de pesquisa, estudos de caso e revis\xe3o.")
ak4=t.createElement("br")
ak5=T.a(bq3)
ak6=t.createElement("br")
ak7=T.a(" - Com rela\xe7\xe3o aos artigos publicados no IEEE Software, aceitamos artigos de pesquisa revisados \u200b\u200bpor pares (n\xe3o s\xe3o aceitos artigos revisados \u200b\u200beditorialmente ou trabalhos convidados).")
ak8=t.createElement("br")
ak9=T.a(bq3)
al0=t.createElement("br")
al1=T.a(' Os autores interessados \u200b\u200bem apresentar artigos journal-first no SBES 2019 devem enviar um e-mail para (rafaelp@pucrs.br) com o assunto "Journal First - SBES 2019" at\xe9 31 de maio de 2019. As seguintes informa\xe7\xf5es devem ser fornecidas: (i) t\xedtulo do trabalho; (ii) lista de autores; (iii) link para o journal; e (iv) uma breve declara\xe7\xe3o sobre como o trabalho satisfaz os crit\xe9rios acima. ')
al2=t.createElement("br")
al3=t.createElement("hr")
al4=t.createElement("h2")
T.d(al4,"PR\xcaMIO DE MELHOR ARTIGO")
al5=t.createElement("br")
al6=T.a(" Todos os anos, o Comit\xea Diretivo do SBES nomeia um comit\xea para premiar os melhores trabalhos do simp\xf3sio. Os trabalhos premiados da trilha de pesquisa s\xe3o anunciados durante o evento.")
al7=t.createElement("br")
al8=T.a(" Os cinco melhores trabalhos da trilha de pesquisa ser\xe3o convidados a submeter uma vers\xe3o estendida em ingl\xeas \xe0 categoria de pesquisa do Journal of Software Engineering Research and Development (JSERD).")
al9=t.createElement("br")
