am3=t.createElement("h2")
T.d(am3,"PR\xcaMIO DE MELHOR REVISOR")
am4=t.createElement("p")
T.d(am4,"O SBES 2019 reconhece a generosidade dos revisores que dedicam seu tempo e melhor esfor\xe7o para revisar os trabalhos submetidos. O progresso do crescimento cient\xedfico depende de colegas dedicados, que visam promover o desenvolvimento da tecnologia, oferecendo sua aten\xe7\xe3o e paix\xe3o ao revisar os artigos. Um certificado de MELHOR REVISOR ser\xe1 concedido ao revisor que enviou excelentes avalia\xe7\xf5es de qualidade ao SBES. A avalia\xe7\xe3o ser\xe1 baseada em dois crit\xe9rios: qualidade e utilidade de revis\xf5es, avaliadas pelos autores dos artigos submetidos e pelos coordenadores do comit\xea de programa.")
