au0=t.createElement("br")
au1=t.createElement("hr")
au2=t.createElement("h2")
T.d(au2,"CATEGORIAS DE ARTIGOS")
au3=t.createElement("p")
T.d(au3,"Os autores dos artigos da trilha de pesquisa, 'ap\xf3s o resumo' no formul\xe1rio de submiss\xe3o, devem indicar em qual das categorias a seguir seu artigo melhor se classifica. Isso pretende estabelecer um conjunto consistente de expectativas no processo de revis\xe3o.")
au4=t.createElement("p")
T.d(au4,"Anal\xedtico: Um artigo no qual a principal contribui\xe7\xe3o se baseia em novos algoritmos ou teoria matem\xe1tica. Os exemplos incluem novas t\xe9cnicas de previs\xe3o de bugs, transforma\xe7\xf5es de modelo, algoritmos para an\xe1lise din\xe2mica e est\xe1tica e an\xe1lise de confiabilidade. Tal contribui\xe7\xe3o deve ser avaliada com uma an\xe1lise convincente dos detalhes algor\xedtmicos, seja atrav\xe9s de uma prova, an\xe1lise de complexidade, ou an\xe1lise de tempo de execu\xe7\xe3o, entre outros.")
au5=t.createElement("p")
T.d(au5,"Experimental (estudo prim\xe1rio): Um artigo no qual a principal contribui\xe7\xe3o \xe9 o estudo experimental de uma tecnologia ou fen\xf4meno de engenharia de software. Isso inclui experimentos controlados, quasi-experimentos, estudos de caso e pesquisas com profissionais que relatam dados qualitativos ou quantitativos e resultados de an\xe1lises. Tal contribui\xe7\xe3o ser\xe1 julgada no desenho do estudo, adequa\xe7\xe3o e corre\xe7\xe3o de sua an\xe1lise e amea\xe7as \xe0 validade. As replica\xe7\xf5es s\xe3o bem vindas.")
au6=t.createElement("p")
T.d(au6,"Revis\xe3o de literatura (estudo secund\xe1rio): Um artigo em que a principal contribui\xe7\xe3o \xe9 a s\xedntese de estudos prim\xe1rios. Exemplos incluem revis\xf5es sistem\xe1ticas e mapeamentos sistem\xe1ticos. Essa contribui\xe7\xe3o deve seguir uma metodologia s\xf3lida e fornecer uma cobertura abrangente da literatura relevante. Al\xe9m disso, deve responder a quest\xf5es de pesquisa relevantes com uma s\xedntese profunda dos resultados. Contribui\xe7\xf5es que fornecem apenas an\xe1lise de metadados (por exemplo, autores relevantes, publica\xe7\xf5es de densidade por ano, artigos mais influentes, etc.) s\xe3o desencorajadas.")
au7=t.createElement("p")
T.d(au7,"Tecnol\xf3gico: Um artigo em que a principal contribui\xe7\xe3o \xe9 de natureza t\xe9cnica. Isso inclui novas ferramentas, linguagens de modelagem, infraestruturas e outras tecnologias. Tal contribui\xe7\xe3o n\xe3o precisa necessariamente ser avaliada com seres humanos. No entanto, argumentos claros, apoiados por evid\xeancias, conforme apropriado, devem mostrar como e por que a tecnologia \xe9 ben\xe9fica, seja na automa\xe7\xe3o ou suporte a alguma tarefa do usu\xe1rio, refinando nossos recursos de modelagem, melhorando algumas propriedades importantes do sistema, etc.")
au8=t.createElement("p")
T.d(au8,"Metodol\xf3gico: Um artigo no qual a principal contribui\xe7\xe3o \xe9 um sistema coerente de princ\xedpios e pr\xe1ticas abrangentes para interpretar ou resolver um problema. Isso inclui novos m\xe9todos de elicita\xe7\xe3o de requisitos, modelos de processos, m\xe9todos de design, abordagens de desenvolvimento, paradigmas de programa\xe7\xe3o e outras metodologias. Os autores devem fornecer argumentos convincentes com experi\xeancias proporcionais, bem como explicar por que um novo m\xe9todo \xe9 necess\xe1rio e quais s\xe3o os benef\xedcios do m\xe9todo proposto.")
au9=t.createElement("hr")
av0=t.createElement("h2")
T.d(av0,"PREPARA\xc7\xc3O DE ARTIGOS, REVIS\xc3O DOUBLE-BLIND E SUBMISS\xc3O")
av1=t.createElement("p")
T.d(av1,"Os trabalhos podem ser submetidos em Portugu\xeas ou Ingl\xeas. A submiss\xe3o em ingl\xeas \xe9 fortemente encorajada, uma vez que os anais do simp\xf3sio ser\xe3o indexados na Biblioteca Digital ACM. A aceita\xe7\xe3o de um artigo implica que pelo menos um de seus autores far\xe1 inscri\xe7\xe3o para participar do simp\xf3sio para apresent\xe1-lo.")
av2=t.createElement("p")
T.d(av2,"Todas as submiss\xf5es devem estar no formato Adobe Portable Document Format (PDF) e devem estar de acordo com o formato ACM de 2 colunas (ACM_SigConf) dispon\xedvel em http://www.acm.org/publications/proceedings-template. Eles n\xe3o devem ter mais de 10 p\xe1ginas, incluindo todas as figuras e refer\xeancias.")
av3=t.createElement("p")
T.d(av3,"Os trabalhos devem ser submetidos eletronicamente atrav\xe9s do JEMS (http://submissoes.sbc.org.br). Todos os trabalhos de pesquisa t\xe9cnica devem indicar, ap\xf3s o resumo, o idioma e uma ou mais das categorias acima mencionadas. As submiss\xf5es que n\xe3o estiverem em conformidade com o formato de submiss\xe3o exigido ou que estiverem fora do escopo do simp\xf3sio, ou que foram enviadas ou publicadas em qualquer outro f\xf3rum (confer\xeancia ou revista), ser\xe3o rejeitadas sem revis\xe3o. Todos os outros trabalhos ser\xe3o revisados \u200b\u200bpor pelo menos tr\xeas membros do comit\xea do programa. Durante o processo de revis\xe3o, podemos solicitar um rebuttal. Neste caso, os autores ter\xe3o acesso \xe0s revis\xf5es e poder\xe3o argumentar e responder \xe0s perguntas dos revisores antes da decis\xe3o final de aceita\xe7\xe3o / rejei\xe7\xe3o. A r\xe9plica \xe9 limitada a um texto simples de at\xe9 4.000 caracteres.")
av4=t.createElement("hr")
av5=t.createElement("h2")
T.d(av5,"SUBMISS\xc3O DOUBLE-BLIND")
av6=T.a("O SBES 2019 seguir\xe1 um processo de revis\xe3o double-blind. Todos os trabalhos submetidos devem ocultar a identidade dos autores. Ambos os nomes de autores e afilia\xe7\xf5es devem ser omitidos. Al\xe9m disso, as seguintes regras devem ser abordadas:\n")
av7=t.createElement("br")
av8=T.a(bq3)
av9=t.createElement("br")
aw0=t.createElement("ul")
T.d(T.c(t,aw0,bt5),"Voc\xea deve garantir que as cita\xe7\xf5es de seu trabalho relacionado sejam escritas na terceira pessoa. Por exemplo, voc\xea deve escrever \u201co trabalho anterior de Silva et al.\u201d Em oposi\xe7\xe3o ao \u201cnosso trabalho anterior\u201d.")
T.d(T.c(t,aw0,bt5),"No artigo submetido, voc\xea n\xe3o deve mencionar nenhum artefato em um reposit\xf3rio ou site que permita identificar a autoria. Se voc\xea precisar disponibilizar qualquer artefato, fa\xe7a de forma an\xf4nima no reposit\xf3rio / website.")
T.d(T.c(t,aw0,bt5),'Se o trabalho submetido for uma evolu\xe7\xe3o de seu trabalho anterior, voc\xea poder\xe1 anonimizar a refer\xeancia no artigo submetido. Por exemplo, \u201co trabalho anterior de Silva et al.\u201d Pode ser adaptado para \u201cbaseado no trabalho anterior [X]\u201d, e a refer\xeancia no final do artigo pode ser apresentada como \u201c[X] autores an\xf4nimos devido \xe0 revis\xe3o em dupla oculta\xe7\xe3o".')
aw1=T.a("Ap\xf3s a aceita\xe7\xe3o do artigo, voc\xea pode incluir todas as informa\xe7\xf5es (sem anonimiza\xe7\xe3o) na vers\xe3o final. ")
aw2=t.createElement("br")
aw3=T.a(bq3)
aw4=t.createElement("br")
aw5=T.a(' Caso voc\xea tenha alguma d\xfavida sobre a prepara\xe7\xe3o do seu trabalho seguindo as regras de submiss\xe3o double-blind, envie um e-mail para os coordenadores de programa com o assunto "SBES: pergunta sobre as regras de double-blind".\n')
aw6=t.createElement("br")
aw7=t.createElement("hr")
aw8=t.createElement("h2")
T.d(aw8,"PROGRAMA DE MENTORIA")
aw9=t.createElement("p")
T.d(aw9,"Autores que nunca publicaram na trilha de pesquisa do SBES ou em outras confer\xeancias internacionais de prest\xedgio, e que pretendem submeter um artigo em 2019 podem solicitar a participa\xe7\xe3o no programa de mentoria. O coordenador do programa designar\xe1 um membro do Comit\xea de Programa para fazer uma avalia\xe7\xe3o preliminar do trabalho e fornecer feedback antes do prazo de submiss\xe3o, aumentando as chances de autores menos experientes.")
ax0=t.createElement("p")
T.d(ax0,"Verifique o prazo para participar do programa na se\xe7\xe3o Datas Importantes, mas note que incentivamos a fazer a solicita\xe7\xe3o o mais r\xe1pido poss\xedvel, pois o n\xfamero de artigos neste programa \xe9 limitado e a distribui\xe7\xe3o ser\xe1 feita por ordem de solicita\xe7\xe3o.")
ax1=t.createElement("p")
T.d(ax1,'ATEN\xc7\xc3O: para participar deste programa, nenhum dos autores pode ter publica\xe7\xf5es anteriores em qualquer edi\xe7\xe3o do SBES ou em qualquer confer\xeancia internacional de prest\xedgio. A solicita\xe7\xe3o deve ser feita exclusivamente por email (Marco.Gerosa@nau.edu) com o assunto "Participa\xe7\xe3o no Programa de Mentoria do SBES". Voc\xea deve incluir no corpo do e-mail o t\xedtulo do trabalho, a lista completa de autores e o resumo.')
