T.d(m,"Beta Ziliani is a researcher and lecturer in the group LIIS at FAMAF, Universidad Nacional de C\xf3rdoba (UNC), and CONICET. He did a PhD with honors at the MPI-SWS under the supervision of Dr. Derek Dreyer, a and a MSc (licenciatura) at FCEyN, Universidad de Buenos Aires (UBA), under the supervision of Alejandro R\xedos. Beta's research primarily focuses on improving interactive theorem provers (ITPs), and the application of ITPs to the verification of proofs. The Mtac projects (Mtac1 and Mtac2) are his most renown work within the community of functional programming in general, and Coq in particular.")
l=t.createElement("br")
k=t.createElement("H2")
