e=t.createElement("br")
d=t.createElement("P")
T.d(d,"Coq is an interactive theorem prover (ITP) that contains a rich dependent type theory, using the Curry-Howard isomorphism to encode proofs as proof terms in the theory. Luckily, the user does not need to construct proof terms by hand: Coq also includes a tactic language, incorporating a more easy-to-use language to build ---and automate--- proofs. Like similar ITPs, the tactic language and the theory of the proof assistant are strictly separated, the former being mostly untyped, making tactics hard to build, maintain, and compose. The Mtac genealogy of projects (Mtac1 and Mtac2) brought a whole new concept to ITPs in general and Coq in particular: it mixes the two languages by encoding in a monad the primitives required to construct meta-programs (Mtac1) and tactics (Mtac2). Tactics written in Mtac's monad inherits the rich type system of Coq, to far-reaching consequences we are yet to explore. In this talk I will present our latest discoveries using dependent types to build concise and safe tactics.")
