a4=t.createElement("p")
T.d(a4,"Jos\xe9 Valim is the creator of the Elixir programming language. He graduated in Engineering from the Polytechnic School of USP and holds a master's degree from Politecnico di Torino in Italy. He is co-founder and Director of R & D of Plataformatec, a consultancy based in S\xe3o Paulo. He is the author of the Adopting Elixir, Phoenix Programming, and Crafting Rails Applications books. Valim also received the prizes of Ruby Hero (2010) and Erlang User of the Year (2015) and currently lives in Krakow, Poland, which has great summers, but the winters are very cold (at least for a Brazilian).")
a5=t.createElement("br")
a6=t.createElement("H2")
